import React from "react";
import Card from "card";
import { Sdata } from "./Sdata";
const Amazon = () => {
  return (
    <Card
      key={Sdata[3].id}
      imgsrc={Sdata[3].imgsrc}
      title={Sdata[3].title}
      sname={Sdata[3].sname}
      link={Sdata[3].link}
    />
  );
};

export default Amazon;
